import { isDevMode } from '@angular/core';

export class BasicLRUCache {
    private _cache = Object.create(null) as { [key: string]: { value: any, uses: number } };
    private _recordsLimit: number;

    constructor(recordsLimit = 1) {
        this.setRecordsLimit(recordsLimit);
    }

    /**
     * check if there is a value in our store
     */
    has(key: string | number): boolean {
        let _key = this._normalizeKey(key);
        return this._cache[_key] !== undefined;
    }

    /**
     * store our state
     */
    set(key: string | number, value: any): void {
        let _key = this._normalizeKey(key);
        this._manageLimit();
        this._cache[_key] = {
            value: value,
            uses: 0
        };
    }

    /**
     * get our cached value
     */
    get(key: string | number): any {
        let _key = this._normalizeKey(key);

        if (this.has(key)) {
            const item = this._cache[_key];
            item.uses++;
            return item.value;
        }

        return undefined;
    }

    erase(label) {
        delete (this._cache[label]);
    }

    /**
     * release memory refs
     */
    clear(): void {
        this._cache = Object.create(null);
    }

    setRecordsLimit(qty: number): void {
        this._recordsLimit = qty;
    }

    size(): number {
        return Object.keys(this._cache).length;
    }

    private _manageLimit() {
        if (this._aboveLimit()) {
            this._eraseLeastUsed();
        }
    }

    private _aboveLimit() {
        return this.size() && this.size() >= this._recordsLimit;
    }

    private _eraseLeastUsed(): void {
        const hash = this._groupRecordsByUseTimes();
        const uses = Object.keys(hash).map(value => Number.parseInt(value, 10));

        if (uses.length > 0) {
            let i = 0;

            while (this._aboveLimit()) {
                const useTimes = uses[i];

                hash[useTimes].forEach(key => {
                    delete (this._cache[key])
                });
                i++;
            }
        }
    }

    private _groupRecordsByUseTimes() {
        return Object.keys(this._cache).reduce((hash, key) => {
            const obj = this._cache[key];

            if (!hash[obj.uses]) {
                hash[obj.uses] = [];
            }

            hash[obj.uses].push(key);

            return hash;
        }, Object.create(null) as { [uses: number]: string[] });
    }

    private _normalizeKey(key: string | number): string {
        if (isDevMode() && this._isInvalidValue(key)) {
            throw new Error('Please provide a valid key to save in the CacheService');
        }

        return JSON.stringify(key);
    }

    private _isInvalidValue(key): boolean {
        return key === null ||
            key === undefined ||
            key === 0 ||
            key === '' ||
            typeof key === 'boolean' ||
            Number.isNaN(<number>key);
    }
}

import { BasicLRUCache } from '../basic-lru-cache.model';

import { ReplaySubject } from 'rxjs/ReplaySubject';


const _generateLabel = (...args) => JSON.stringify(args);
export function RxCache({cache, generateLabel = _generateLabel}: {cache: BasicLRUCache, generateLabel?: (...args) => number|string}) {    

    return function _RxCache(target: any, propertyKey: string, descriptor: PropertyDescriptor) {
       const originalMethod = descriptor.value;

       descriptor.value = (...args) => {
           const label = generateLabel(...args);
           let cached: ReplaySubject<any> = cache.get(label);

           if (!cached) {
               cached = new ReplaySubject(1);
               cache.set(label, cached);

               originalMethod.call(target, ...args).subscribe(
                   (resp) => cached.next(resp),
                   (err) => {
                       cached.error(err);
                       cached = null;
                       cache.erase(label);
                   }
                );
           };

           return cached;
       } 

        Object.defineProperty(target, propertyKey, descriptor);
       return descriptor.value;
    };
}

import { BasicLRUCache } from '../basic-lru-cache.model';
export function SyncCache({cache}: {cache: BasicLRUCache}) {

    return function _ObservableCache(target: any, propertyKey: string, descriptor: PropertyDescriptor) {
       const originalMethod = descriptor.value;

       descriptor.value = (...args) => {
           let cached = cache.get(JSON.stringify(args));

           if (!cached) {
               cached = originalMethod.call(target, ...args)
               cache.set(JSON.stringify(args), cached);
           };

           return cached;
       } 

        Object.defineProperty(target, propertyKey, descriptor);
       return descriptor.value;
    };
}

export { Indicador, IndicadorParameters } from './indicador.model'
export { Pesquisa } from './pesquisa.model'
export { Resultado } from './resultado.model';

import { ResultadoDTO } from '../dto/resultado.interface';
import { IndicadorDTO } from '../dto';
import { Pesquisa, Resultado } from './'
import { escopoIndicadores } from '../values'

export interface IndicadorParameters extends IndicadorDTO {
    id: number;
    indicador: string;
    posicao: string;
    classe: string;
    children: IndicadorParameters[]
    pesquisa_id?: number
    pesquisa?: Pesquisa
    nota: string[]
    metadado?: {
        descricao: string
        calculo: string
    }
    unidade?: {
        id: string
        classe: string
        multiplicador: number
    },
    resultados?: Resultado[]
}

export class Indicador {
    static criar(dados: IndicadorParameters) {
        return new Indicador(dados);
    }

    public readonly id: number;
    public readonly nome: string;
    public readonly posicao: string;
    public readonly classe: string;
    public readonly pesquisaId?: number
    public readonly pesquisa?: Pesquisa
    public readonly indicadores: Indicador[]
    public readonly notas: string[]
    public readonly metadados: {
        descricao: string
        calculo: string
    }
    public readonly unidade: {
        nome: string
        classe: string
        multiplicador: number
    }
    public readonly resultados?: Resultado[]

    constructor(dados: IndicadorParameters) {
        if (!dados.pesquisa && !dados.pesquisa_id) {
            throw new Error('Obrigatrio informar a id da pesquisa ou passar o objeto Pesquisa completo para o construtor do Indicador');
        }

        this.id = dados.id;
        this.nome = dados.indicador;
        this.posicao = dados.posicao;
        this.classe = dados.classe;
        this.notas = dados.nota.slice(0);

        this.indicadores = dados.children.map(child => {
            return dados.pesquisa
                ? Indicador.criar(Object.assign(child, { pesquisa: dados.pesquisa }))
                : Indicador.criar(Object.assign(child, { pesquisa_id: dados.pesquisa_id }))
        });

        this.metadados = Object.assign({
            descricao: '',
            calculo: ''
        }, dados.metadado);

        if (dados.unidade) {
            this.unidade = {
                nome: dados.unidade.id || '',
                classe: dados.unidade.classe || '',
                multiplicador: dados.unidade.multiplicador || 1
            }
        } else {
            this.unidade = { nome: '', classe: '', multiplicador: 1 };
        }

        if (dados.pesquisa_id && !dados.pesquisa) { this.pesquisaId = dados.pesquisa_id; }
        if (dados.pesquisa) { this.pesquisa = dados.pesquisa; }

        if (dados.res) { this.resultados = Resultado.convertDTOintoParameters({ id: this.id, res: dados.res }).map(Resultado.criar); }
    }

    getResultadoByLocal(localidadeCodigo: number): Resultado {
        return this.resultados.find(resultado => resultado.localidadeCodigo === localidadeCodigo) || null;
    }
}

import { NiveisTerritoriais } from '../../shared2/localidade/localidade.model';
import { arrayUniqueValues, converterEmNumero } from '../../utils2';
import { PesquisaDTO } from '../dto';
import { niveisTerritoriais, listaNiveisTerritoriais } from '../values';

export class Pesquisa {
    static criar(data: PesquisaDTO) {
        return new Pesquisa(data);
    }

    static get niveisTerritoriaisPossiveis() {
        return listaNiveisTerritoriais.slice(0);
    }

    public readonly id: number
    public readonly nome: string
    public readonly descricao: string
    public readonly observacao: string
    public readonly periodos: Array<{
        nome: string,
        dataPublicacao: Date,
        fontes: string[],
        notas: string[]
    }>
    public readonly contextos: { [nivelTerritorial: string]: boolean }

    constructor(dados: PesquisaDTO) {
        this.id = dados.id;
        this.nome = dados.nome;
        this.descricao = dados.descricao || "";
        this.observacao = dados.observacao || "";
        this.periodos = this._setPeriodos(dados.periodos);
        this.contextos = this._setContextos(Number.parseInt(dados.contexto, 10));
    }

    abrangeNivelTerritorial(contexto: string) {
        return this.contextos[contexto];
    }

    getAbrangenciaTerritorialDaPesquisa(): string[] {
        return Pesquisa.niveisTerritoriaisPossiveis.filter(contexto => Boolean(this.contextos[contexto]));
    }

    getAllFontes() {
        const fontes = this.periodos.reduce((fontes, periodo) => fontes.concat(periodo.fontes), [] as string[]);
        return arrayUniqueValues(fontes);
    }

    getFontesDoPeriodo(periodo: string) {
        const obj = this.periodos.find(_periodo => _periodo.nome === periodo);
        return obj ? obj.fontes : [];
    }

    getAllNotas() {
        const notas = this.periodos.reduce((notas, periodo) => notas.concat(periodo.notas), [] as string[]);
        return arrayUniqueValues(notas);
    }

    getNotasDoPeriodo(periodo: string) {
        const obj = this.periodos.find(_periodo => _periodo.nome === periodo);
        return obj ? obj.notas : [];
    }

    private _setContextos(binario: number) {
        const contextos = Boolean(binario)
            ? binario.toString()
                .split('')
                .reverse()
                .map(str => Number.parseInt(str))
            : [];

        const len = contextos.length;
        contextos.length = 6;
        contextos.fill(0, len);
        contextos.reverse();

        return Pesquisa.niveisTerritoriaisPossiveis.reduce((acc, propertyName, index) => {
            acc[propertyName] = Boolean(contextos[index]);
            return acc;
        }, {});
    }

    private _setPeriodos(periodos) {
        return periodos.map(periodo => {
            const nome = periodo.periodo;
            const fontes = periodo.fonte;
            const notas = periodo.nota;
            let dataPublicacao = null;

            if (periodo.publicacao) {
                const [data, horario] = periodo.publicacao.split(' ');
                const [dia, mes, ano] = data.split('/').map(converterEmNumero);
                const [hora, minuto, segundo] = horario.split(':').map(converterEmNumero);
                dataPublicacao = new Date(Date.UTC(ano, mes - 1, dia, hora, minuto, segundo));
            }

            return {
                nome,
                dataPublicacao,
                fontes,
                notas
            };
        })
    }
}

import { ResultadoDTO } from '../dto';
import { Indicador } from '.';

export interface ResultadoParameters {
    id: number
    localidade: string
    res?: { [periodo: string]: string }
}
export class Resultado {
    static criar(dados: ResultadoParameters) {
        return new Resultado(dados);
    }
    static convertDTOintoParameters(dados: ResultadoDTO | ResultadoDTO[]): ResultadoParameters[] {
        const array = Array.isArray(dados) ? dados : [dados];

        return array.reduce((acc, dados) => {
            let arr = dados.res.map(item => ({
                id: dados.id,
                localidade: item.localidade,
                res: item.res
            }))
            return acc.concat(arr);
        }, []);
    }

    public readonly indicadorId?: number
    public readonly indicador?: Indicador
    public readonly localidadeCodigo: number
    public readonly periodos: string[]
    public readonly valores: string[]

    constructor({ id, localidade, res = [] } = {} as ResultadoParameters) {
        this.indicadorId = id;
        this.localidadeCodigo = Number.parseInt(localidade, 10);

        const periodos = Object.keys(res).sort().reverse();
        this.periodos = periodos;
        this.valores = periodos.map(periodo => res[periodo]);
    }

    get valoresValidos() {
        return this.valores.filter(this._isValorValido);
    }

    get valorMaisRecente() {
        return this.valores[0] || '-';
    }

    get valorValidoMaisRecente() {
        return this.valoresValidos[0] || '-';
    }

    get periodosValidos() {
        return this.valores.reduce((arr, valor, idx) => {
            if (this._isValorValido(valor)) {
                arr.push(this.periodos[idx]);
            }
            return arr;
        }, [] as string[]);
    }

    get periodoMaisRecente() {
        return this.periodos[0];
    }

    get periodoValidoMaisRecente() {
        return this.periodosValidos[0] || '-';
    }

    public getValor(periodo) {
        const index = this.periodos.indexOf(periodo);
        return index >= 0 ? this.valores[index] : '-';
    }

    private _isValorValido(valor) {
        return valor !== null && valor !== undefined;
    }
}

import { Component } from '@angular/core';
import { Observable } from 'rxjs/Observable';
import { BehaviorSubject } from 'rxjs/BehaviorSubject';
import { Subject } from 'rxjs/Subject';
import 'rxjs/add/operator/share';

export class FooService {

    @BatchRequest({passThrough: true})
    passingThrough(id) {
        return this.simulateHttpRequest(id);
    }

    @BatchRequest({passThrough: false})
    batch(arr) {
        return this.simulateHttpRequest(arr);
    }

    simulateHttpRequest(id: number | number[]) {
        const arr = Array.isArray(id) ? id : [id];
        return Observable.of(arr.map(id => ({id: id})));
    }
}

function BatchRequest(filterFn, { debounceTime = 10, passThrough = false } = {}) {
    let argumentsQueue = [];
    let clearTimeoutId = null;

    const updateArgumentsQueue = function (...args) {
        argumentsQueue.push(args)
    }
    const queueCalls = function (callback, context) {
        if (clearTimeoutId) return;

        clearTimeoutId = setTimeout(() => {
            callback.apply(context, argumentsQueue).subscribe(val => {
                console.log('callback', val);
                results.next(val)
            });
            reset();
        }, debounceTime)
    }

    const reset = function() {
        argumentsQueue = [];
        clearTimeoutId = null;
    }

    const results = new Subject();
    const response = results.asObservable().share();


    return function _batchRequestDecorator(target: any, propertyKey: string, descriptor: PropertyDescriptor) {
        const originalMethod = descriptor.value.bind(target);

        descriptor.value = (...args) => {
            if (passThrough || originalMethod.__batchRequestDecorated) {
                console.log('test flag', originalMethod.__batchRequestDecorated);
                return originalMethod.apply(target, args);
            } 
            const sub = new Subject();
            const subs = response
                .subscribe(val => {
                    sub.next(val);
                    subs.unsubscribe();
                })

            updateArgumentsQueue(args);
            queueCalls(originalMethod, target);

            return sub.asObservable().filter(filterFn);
        };

        descriptor.value.__batchRequestDecorated = true;
    };
}

export { IndicadorService3 } from './indicador.service';
export { PesquisaService3 } from './pesquisa.service';
export { ResultadoService3 } from './resultado.service';

import { Injectable } from '@angular/core';
import { Http, Headers, RequestOptions } from '@angular/http';

import { PesquisaService3 } from '.';
import { Indicador, Pesquisa } from '../models';
import { escopoIndicadores, ServicoDados as servidor } from '../values';
import { arrayUniqueValues, converterObjArrayEmHash } from '../../utils2';

import { Observable } from 'rxjs/Observable';
import 'rxjs/add/observable/throw';
import 'rxjs/add/observable/zip';
import 'rxjs/add/operator/catch';
import 'rxjs/add/operator/map';
import 'rxjs/add/operator/mergeMap';
import 'rxjs/add/operator/retry';
import 'rxjs/add/operator/share';


const headers = new Headers({ 'accept': '*/*' });
const options = new RequestOptions({ headers: headers, withCredentials: false });

@Injectable()
export class IndicadorService3 {

    constructor(
        private _http: Http,
        private _pesquisaService: PesquisaService3
    ) { }

    getIndicadoresDaPesquisa(pesquisaId: number, { arvoreCompleta = false, localidades = [] as Array<number | string> } = {}): Observable<Indicador[]> {
        return this.getIndicadoresFilhosByPosicao(pesquisaId, '0', { arvoreCompleta, localidades })
            .catch(err => this._handleError(err));
    }

    getIndicadoresFilhosByPosicao(pesquisaId: number, posicao: string, { arvoreCompleta = false, localidades = [] as Array<number | string> } = {}): Observable<Indicador[]> {
        const escopo = arvoreCompleta ? escopoIndicadores.arvoreCompleta : escopoIndicadores.filhos;
        const url = servidor.setUrl(`pesquisas/${pesquisaId}/periodos/all/indicadores/0?scope=${escopo}&localidade=${localidades.join(',')}`);
        const errorMessage = `No foi possvel recuperar os indicadores solicitados. [pesquisaId: ${pesquisaId}, escopo: ${escopo}]`;

        return this._request(url)
            .map(arr => arr.map(obj => Indicador.criar(Object.assign(obj, { pesquisa_id: pesquisaId }))))
            .catch(err => this._handleError(err, new Error(errorMessage)))
    }
    getIndicadoresFilhosComPesquisaByPosicao(pesquisaId: number, posicao: string, { arvoreCompleta = false, localidades = [] as Array<number | string> } = {}): Observable<Indicador[]> {
        const escopo = arvoreCompleta ? escopoIndicadores.arvoreCompleta : escopoIndicadores.filhos;
        const url = servidor.setUrl(`pesquisas/${pesquisaId}/periodos/all/indicadores/0?scope=${escopo}&localidade=${localidades.join(',')}`);
        const errorMessage = `No foi possvel recuperar os indicadores solicitados. [pesquisaId: ${pesquisaId}, escopo: ${escopo}]`;

        return Observable.zip(this._request(url), this._pesquisaService.getPesquisa(pesquisaId))
            .map(([arr, pesquisa]) => arr.map(obj => Indicador.criar(Object.assign(obj, { pesquisa: pesquisa }))))
            .catch(err => this._handleError(err, new Error(errorMessage)))
    }

    getIndicadoresById(indicadoresId: number[], localidades = [] as Array<number | string>): Observable<Indicador[]> {
        const url = servidor.setUrl(`pesquisas/indicadores/${indicadoresId.join('|')}?localidade=${localidades.join(',')}`);
        const errorMessage = `No foi possvel retornar indicadores para os parmetros informados. [id: ${indicadoresId.join(', ') || 'nenhum valor informado'}]`

        return this._request(url)
            .map(array => array.map(Indicador.criar))
            .catch(err => this._handleError(err, new Error(errorMessage)));
    }

    getIndicadoresComPesquisaById(indicadoresId: number[], localidades = [] as Array<number | string>): Observable<Indicador[]> {
        const url = servidor.setUrl(`pesquisas/indicadores/${indicadoresId.join('|')}?localidade=${localidades.join(',')}`);
        const errorMessage = `No foi possvel retornar indicadores para os parmetros informados. [id: ${indicadoresId.join(', ') || 'nenhum valor informado'}}]`

        return this._request(url)
            .mergeMap(responseIndicadores => {
                const pesquisasId = arrayUniqueValues(responseIndicadores.map(obj => obj.pesquisa_id));
                return this._pesquisaService.getPesquisas(pesquisasId).map(pesquisas => [responseIndicadores, pesquisas]);
            })
            .map(([responseIndicadores, pesquisas]) => {
                const hashPesquisas = converterObjArrayEmHash(pesquisas, 'id');
                return responseIndicadores.map(obj => Indicador.criar(Object.assign(obj, { pesquisa: hashPesquisas[obj.pesquisa_id] })))
            })
            .catch(err => this._handleError(err, new Error(errorMessage)));
    }


    private _request(url: string) {
        return this._http.get(url, options)
            .retry(3)
            .map(res => {
                if (res.status === 404) {
                    throw new Error(`No foi encontrado o endereo solicitado. [url: ${url}]`);
                }

                if (res.status === 400 || res.status === 500) {
                    throw new Error();
                }

                const obj = res.json();
                if (this._isServerError(obj)) {
                    throw new Error();
                }

                return obj;
            })
            .share();
    }

    private _handleError(error: Error, customError?: Error): Observable<any> {
        return Observable.throw(error.message ? error : customError);
    }

    private _isServerError(res) {
        return Object.keys(res).length === 1 && Object.prototype.hasOwnProperty.apply(res, 'message');
    }

}

import { Injectable } from '@angular/core';
import { Http, Headers, RequestOptions } from '@angular/http';

import { converterObjArrayEmHash } from '../../utils2';
import { PesquisaDTO } from '../dto';
import { Indicador, Pesquisa } from '../models';
import { escopoIndicadores, listaNiveisTerritoriais, ServicoDados as servidor } from '../values';

import { Observable } from 'rxjs/Observable';
import 'rxjs/add/observable/throw';
import 'rxjs/add/operator/do';
import 'rxjs/add/operator/catch';
import 'rxjs/add/operator/map';
import 'rxjs/add/operator/retry';

const headers = new Headers({ 'accept': '*/*' });
const options = new RequestOptions({ headers: headers, withCredentials: false });

@Injectable()
export class PesquisaService3 {

    constructor(
        private _http: Http
    ) { }

    getAllPesquisas(): Observable<Pesquisa[]> {
        const url = servidor.setUrl('pesquisas');
        const errorMessage = `No foi possvel recuperar as pesquisas`;

        return this._request(url)
            .map(arr => arr.map(Pesquisa.criar))
            .catch(err => this._handleError(err, new Error(errorMessage)));
    }

    getPesquisasPorAbrangenciaTerritorial(nivelTerritorial: string): Observable<Pesquisa[]> {
        if (Pesquisa.niveisTerritoriaisPossiveis.indexOf(nivelTerritorial) === -1) {
            const errorMessage = `No existe o nvel territorial pesquisado. Favor verifique sua solicitao. [nivelterritorial: ${nivelTerritorial}]`;
            return this._handleError(new Error(errorMessage));
        }

        return this.getAllPesquisas()
            .map(pesquisas => pesquisas.filter(pesquisa => pesquisa.abrangeNivelTerritorial(nivelTerritorial)))
            .catch(err => this._handleError(err));
    }

    getPesquisas(pesquisasId: number[]): Observable<Pesquisa[]> {
        return this.getAllPesquisas()
            .map(pesquisas => {
                const hashPesquisasById = converterObjArrayEmHash(pesquisas, 'id');
                return this._filterPesquisas(hashPesquisasById, pesquisasId);
            })
            .catch(err => this._handleError(err));
    }

    getPesquisa(pesquisaId: number): Observable<Pesquisa> {
        const url = servidor.setUrl(`pesquisas/${pesquisaId}`);
        const errorMessage = `No foi possvel recuperar a pesquisa solicitada. Verifique a solicitao ou tente novamente mais tarde. [id: ${pesquisaId}]`;

        return this._request(url)
            .map(Pesquisa.criar)
            .catch(err => this._handleError(err, new Error(errorMessage)));
    }

    private _request(url: string): Observable<any> {
        return this._http.get(url, options)
            .retry(3)
            .map(res => {
                if (res.status === 404) {
                    throw new Error(`No foi encontrado o endereo solicitado. [url: ${url}]`);
                }

                if (res.status === 400 || res.status === 500) {
                    throw new Error();
                }

                const obj = res.json();
                if (this._isServerError(obj)) {
                    throw new Error();
                }

                return obj;
            });
    }

    private _handleError(error: Error, customError?: Error): Observable<any> {
        return Observable.throw(error.message ? error : customError);
    }

    private _isServerError(res) {
        return Object.keys(res).length === 1 && Object.prototype.hasOwnProperty.apply(res, 'message');
    }

    private _filterPesquisas(hash, pesquisasId) {
        const obj = pesquisasId.reduce((acc, id) => {
            if (hash[id]) {
                acc.pesquisas.push(hash[id])
            } else {
                acc.errors.push(id);
            }
            return acc;
        }, { pesquisas: [] as Pesquisa[], errors: [] as number[] })

        if (obj.errors.length > 0) {
            throw new Error(`No foram encontradas todas as pesquisas solicitadas. [ids: ${obj.errors.join(', ')}]`)
        }

        return obj.pesquisas;
    }
}

import { Injectable } from '@angular/core';
